import { Col, Row } from "antd";
import styled from "styled-components";

import { ComponentFaceBookButton, ComponentGoogleButton, ComponentLineButton } from "@components";

interface IProps {
    socials: JSX.Element[];
}

export const ComponentSocialMedia = (props: IProps) => {
    const { socials } = props;
    //
    return (
        <StyledContainer>
            <Row gutter={8}>
                {socials.map((item) => {
                    return <Col span={24 / socials.length}>{item}</Col>;
                })}
            </Row>
        </StyledContainer>
    );
};

const StyledContainer = styled.div`
    padding: 42px 16px;
`;
